    function emoji() { }


    return (
        <div className="messagingSend">
            <div id="send">
                <textarea className="sendInput"></textarea>
                <div className="submit"><span>Send</span></div>
                <div className="emojiButton" onClick={emojiOpen()}><img src="./icons/icons_alien.png" className="emojiButton" /> </div>
            </div>
            <EmojiPicker style={style} onEmojiClick={emoji()} />
        </div>
    )
}
